css:
body {
    background-color: rgb(34, 34, 34);
}

h1,
h2,
h3,
p,
span {
    color: rgb(255, 252, 245) !important;
}

h2:first-letter {
    text-transform: uppercase;
}

header,
header a,
header button,
footer {
    background-color: rgb(87, 87, 87) !important;
}

header a,
footer a:hover {
    color: rgb(255, 252, 245) !important;
}

header a:hover,
footer a {
    color: rgb(34, 34, 34) !important;
}
